import React, { useState, useEffect } from 'react';

function App() {
  const [devices, setDevices] = useState([]);
  const [loggedIn, setLoggedIn] = useState(false);
  const [loading, setLoading] = useState(false);
  const [loginError, setLoginError] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  useEffect(() => {
    if (loggedIn) {
      fetch('/api/devices')
        .then(res => res.json())
        .then(setDevices)
        .catch(() => setDevices([]));
    }
  }, [loggedIn]);

  const handleLogin = () => {
    // Simple hardcoded login for demo. Replace with backend call for production.
    if (username === "admin" && password === "secure123") {
      setLoggedIn(true); setLoginError("");
    } else {
      setLoginError("Invalid credentials");
    }
  };

  const handleAction = (deviceId, action) => {
    setLoading(true);
    fetch(`/api/device/${action}`, {
      method: "POST",
      headers: { "Content-Type": "text/plain" },
      body: deviceId
    })
      .then(res => res.json())
      .then(() => {
        // Refresh list
        fetch('/api/devices')
          .then(res => res.json())
          .then(setDevices)
          .finally(() => setLoading(false));
      })
      .catch(() => setLoading(false));
  };

  if (!loggedIn) {
    return (
      <div style={{background:'#222',height:'100vh',display:'flex',alignItems:'center',justifyContent:'center'}}>
        <div style={{background:'#333',padding:36,borderRadius:12}}>
          <h2 style={{color:'#fff'}}>Admin Login</h2>
          <input type="text" placeholder="Username" value={username} onChange={e=>setUsername(e.target.value)}
            style={{marginBottom:8,padding:8}} /><br/>
          <input type="password" placeholder="Password" value={password} onChange={e=>setPassword(e.target.value)}
            style={{marginBottom:8,padding:8}} /><br/>
          <button onClick={handleLogin} style={{padding:'8px 22px'}}>Login</button>
          {loginError && <div style={{color:'red',marginTop:8}}>{loginError}</div>}
        </div>
      </div>
    );
  }

  return (
    <div style={{padding: '32px', background: '#181b2a', minHeight: '100vh', color: '#fff'}}>
      <h1 style={{marginBottom:24}}>USB Device Monitoring Dashboard</h1>
      {loading && <div>Updating...</div>}
      <table style={{width: '100%', background: '#232439', marginTop: 20, borderCollapse: 'collapse'}}>
        <thead>
          <tr>
            <th style={{padding:8}}>Device ID</th>
            <th style={{padding:8}}>Name</th>
            <th style={{padding:8}}>Status</th>
            <th style={{padding:8}}>Path</th>
            <th style={{padding:8}}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {devices.map(dev => (
            <tr key={dev.deviceId}>
              <td style={{padding:8}}>{dev.deviceId}</td>
              <td style={{padding:8}}>{dev.friendlyName}</td>
              <td style={{padding:8}}>
                {dev.isAllowed ?
                  <span role="img" aria-label="Allowed">ðŸŸ¢ Allowed</span> :
                  <span role="img" aria-label="Blocked">ðŸ”´ Blocked</span>
                }
              </td>
              <td style={{padding:8}}>{dev.devicePath}</td>
              <td style={{padding:8}}>
                <button disabled={dev.isAllowed} onClick={()=>handleAction(dev.deviceId,'allow')}>Allow</button>
                <button disabled={!dev.isAllowed} onClick={()=>handleAction(dev.deviceId,'deny')}>Deny</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
